import React from 'react'

const ErrorLayout =({children}) =>{
    return(
        <div className="container">
            <div className="row">
                <div className="col-lg-3">
                    <div className="blog-main">
                        { children}
                    </div>
                </div>
                <div className="col-lg-3">
                    <div className="blog-sidebar">
                        <h2>Sidebar</h2>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default ErrorLayout;
